export default function MovieOverlay(props) {
  return (
    <div className="cover-over">
      <div className="overlay-bg">
        <h1>{props.movieData.title}</h1>
        <div>
          <img
            src={`https://image.tmdb.org/t/p/w500${props.movieData.poster}`}
            alt={`${props.movieData.title} Poster`}
            className="film-Poster"
          />
          <p>{props.movieData.overview}</p>
        </div>
      </div>
    </div>
  );
}
